import { Booking} from "./booking";

export const Bookings: Booking[] = [

    {
        id: 1,
        name: "John",
        roomNumber: 100,
        startDate: new Date(),
        endDate: new Date()
      },
      {
        id: 2,
        name: "Mike",
        roomNumber: 200,
        startDate: new Date(),
        endDate: new Date()
      },
      {
        id: 3,
        name: "Joe",
        roomNumber: 300,
        startDate: new Date(),
        endDate: new Date()
      }

];
